package it.prova.coge_be;

import java.time.LocalDate;
import java.util.Base64;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.CommandLineRunner;
import org.springframework.boot.SpringApplication;
import org.springframework.boot.autoconfigure.SpringBootApplication;

import it.prova.coge_be.model.Attachment;
import it.prova.coge_be.model.Azienda;
import it.prova.coge_be.model.Commessa;
import it.prova.coge_be.model.Risorsa;
import it.prova.coge_be.service.attachment.AttachmentService;
import it.prova.coge_be.service.azienda.AziendaService;
import it.prova.coge_be.service.commessa.CommessaService;
import it.prova.coge_be.service.risorsa.RisorsaService;

@SpringBootApplication
public class CogeBeApplication implements CommandLineRunner {

	@Autowired
	private AttachmentService attachmentService;
	@Autowired
	private AziendaService aziendaService;
	@Autowired
	private CommessaService commessaService;
	@Autowired
	private RisorsaService risorsaService;

	public static void main(String[] args) {
		SpringApplication.run(CogeBeApplication.class, args);
	}

	@Override
	public void run(String... args) throws Exception {
		System.err.println("**********************************");

		byte[] payload = Base64.getDecoder().decode(
				"");
		byte[] payload2 = Base64.getDecoder().decode(
				"");

		Attachment att = Attachment.builder().dataCreazione(LocalDate.parse("2010-04-11"))
				.descrizione("cv prova test 1").fileName("cv fake di David").payload(payload).build();
		Attachment att2 = Attachment.builder().dataCreazione(LocalDate.parse("2014-04-11"))
				.descrizione("cv prova test 2").fileName("cv fake di David un altra volta").payload(payload2).build();
		
		
		
		Risorsa risorsa1 = Risorsa.builder().nome("LeBron").cognome("James")
		.costoGiornaliero(85).dataIn(LocalDate.parse("2020-01-03")).cv(att).build();
		Risorsa risorsa2 = Risorsa.builder().nome("Micheal").cognome("Jordan")
				.costoGiornaliero(90).dataIn(LocalDate.parse("2004-01-03")).cv(att2).build();
		
		Commessa commessa = Commessa.builder().dataIn(LocalDate.parse("2022-01-01")).codice("0100112").descrizione("prova nba azienda").build();
		commessa.getRisorse().add(risorsa1);
		risorsa1.getCommesse().add(commessa);
		
		Azienda azienda = Azienda.builder().ragioneSociale("NBA k23").partivaIva("0123asd").indirizzo("via usa").build();
//		
		
		attachmentService.inserisciNuovo(att);
		attachmentService.inserisciNuovo(att2);
		risorsaService.inserisciNuovo(risorsa1);
		risorsaService.inserisciNuovo(risorsa2);
		
		aziendaService.inserisciNuovo(azienda);
		
		commessaService.inserisciNuovo(commessa);
		
		azienda.getCommesse().add(commessa);
		commessa.setAzienda(azienda);
		
		aziendaService.aggiorna(azienda);
		commessaService.aggiorna(commessa);

	}
}